import React, {Component} from 'react'

class RecipeComponent extends Component {
    constructor(props){
        super(props)
        this.state = {
            id: 1,
            name: "Cooked Chicken",
            directions: "Cook it.",
            ingredients: "a chicken"
        }
    }

    render() {
        return <div>Recipe Component for id - {this.props.match.params.id}</div>
    }
}

export default RecipeComponent
